import React from "react";
import styled from "styled-components";
// import { Footer } from "../../components/footer";
import { Marginer } from "../../components/marginer";
import { Navbar } from "../../components/navbar";
import {
  InnerPageContainer,
  PageContainer,
} from "../../components/pageContainer";
import { deviceSize } from "../../components/responsive";
// import { SpecialistAd } from "../../components/specialistAd";
// import { Services } from "./services";
import { TopSection } from "./topSection";

const Title = styled.h1`
font-weight: 900;
color: #000;
`;

const ContentContainer =styled.div`
width: 100;
max-width: $(deviceSize.laptop)px;
display: flex;
flex-direction: column;
align-items: flex-start;
`;

const service = { "id": 1, "title": "I will landscape your garden", 
"thumbnailUrl": "http://localhost:9000/garden.jpg", "rate": 34,
"rating": 4, "specialist": { "id": 1, "fullName": "Mark brone" },
}


export function Homepage(props){
    return <pageContainer>
        <TopSection >
            <Navbar/>
            </TopSection>
            <InnerPageContainer>
               <ContentContainer>
                   <Title>
                    Most used services & more
                   </Title>
                   <ServiceCard { ...service} />
               </ContentContainer>
            </InnerPageContainer>
</pageContainer>
}
